import React from 'react'
//css
import './Checkbox.css'

export default function Checkbox(props) {
    return (
        <div>
            <div class="inputGroup">
                <input id="option1" name="option1" type="checkbox"/>
                <label for="option1">Option One</label>
            </div>
        </div>
    )
}
